import React, { useState, useEffect } from 'react';
import axios from 'axios';
import NavHeader from '../../components/NavHeader/NavHeader';
import Header from '../../components/Header';
import { PainelNoticias } from '../../components/Noticias/PainelNoticias';
import Footer from '../../components/footer/Footer';
export const Equipes = () => {
  const [posts, setPosts] = useState([]);


  useEffect(() => {
    axios.get("https://king-prawn-app-bnxyc.ondigitalocean.app/api/noticias?populate=*")
      .then((response) => {
        const { data } = response.data;
        setPosts(data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);




  return (
    <>
      <NavHeader />
      <Header />
      {posts.map((post, index) => {
       const image1Url = images[`${post.id}`];
       const image2Url = images[`${post.id}`];
        console.log("TESTE", image1Url)
        return (
          <div className='container_noticias' key={post.id}>
            <h2>{post?.attributes?.local}</h2>
            <p>{post?.attributes?.data}</p>
            {Object.keys(images).includes(`${post.id}-equipe1`) && Object.keys(images).includes(`${post.id}-equipe2`) && (
              <div className="container_imagens">
                <img href={"https://king-prawn-app-bnxyc.ondigitalocean.app" + post?.attributes.time1.data[0].attributes.url} alt="" />
                <img href={"https://king-prawn-app-bnxyc.ondigitalocean.app" + post?.attributes.time2.data[0].attributes.url} alt="" />
              </div>
            )}

          </div>
        );
      })}
      <Footer />

    </>
  );

};
